import React from "react";

function App() {
  return (
    <div>
      <form>
        <label>Username</label>
        <input type="text" />
        <label>Age (Years)</label>
        <input type="number" />
        <button type="submit">Add user</button>

      </form>
    </div>
  );
}

export default App;
